import getPreviewDataToImport from '../getPreviewDataToImport';
import getImportParams from './getImportParams';
describe('getPreviewDataToImport', function () {
  it('should return right data', function () {
    var params = getImportParams();
    var previewData = getPreviewDataToImport(params.data, params.fieldsMap, params.schema.attributes);
    var expectedPreviewData = [{
      name: 'John Doe',
      email: 'jonh@gmail.com'
    }, {
      name: 'Jane Doe',
      email: 'jane@gmail.com'
    }, {
      name: 'Fred Flinstone',
      email: 'fred@gmail.com'
    }];
    expect(previewData).toEqual(expectedPreviewData);
  });
});